import React from 'react';

const Home = React.lazy(() => import('./views/backend/Home'));
const AdminIndex = React.lazy(() => import('./views/backend/admin/Index'));
const AdminCreate = React.lazy(() => import('./views/backend/admin/Create'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/admin', exact: true, name: 'Home',component:Home },
  { path: '/admin/manager', exact: true, name: 'AdminIndex',component:AdminIndex },
  { path: '/admin/manager/create', exact: true, name: 'AdminIndex',component:AdminCreate }
];

export default routes;
